  false,\n\t\"url\": null,\n\t\"notes\": \"Geology and hydrothermal alteration in
  northwestern Black Mountains and southern Shauntie Hills, Beaver and Iron Counties,
  Utah. Zones of hydrothermal alteration are exposed within the tertiary Isom Ignimbrite
  and within local , rhyolitic and andesitic flow-rock in the northwestern Black Mountains
  and southern Shauntie Hills of southwestern Utah. Alteration in both zones primarily
  consits of argillization and alunitization, but concentrations od silica and iron
  oxied also are present. No economic mineralization occurs in the surface rocks of
  either zone. n\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
